import React from 'react'
import Button from 'react-bootstrap/Button'

const BookmarkButton = () => {
  return (
    <Button variant="link">
      <span>
        <img src="https://pics.freeicons.io/uploads/icons/png/15746672971543238863-512.png"/>
      </span>
    </Button>
  )
}

export default BookmarkButton
